import { Card, CardActions, CardContent, Typography } from "@mui/material";
import React from "react";
import { ReactComponent as TelevisionIcon } from "../assets/images/television.svg";

export const CustomCard = (props) => {
  const { Info, ...other } = props;

  return (
    <>
      <Card
        sx={{
          borderRadius: "1rem",
          background: "linear-gradient(149deg, #192247 0%, #210e17 96.86%)",
          width:"400px",
          height:"300px"
        }}
      >
        <CardContent>
          <Typography mt={'20px'} fontWeight={500} fontSize={"1.5rem"} color="white">
            Enjoy on your TV
          </Typography>
          <Typography
          mt={'20px'}
            color="rgba(255, 255, 255, 0.7)"
            fontSize={"1rem"}
            fontWeight={400}
          >
            Watch on smart TVs, PlayStation, Xbox, Chromecast, Apple TV, Blu-ray
            players and more.
          </Typography>
        </CardContent>

        <TelevisionIcon style={{ position:"relative", width: 80, height: 80 ,marginLeft:'300px',marginTop:"100px"}} />
      </Card>
    </>
  );
};

export default CustomCard;
